import styled from 'styled-components'

const Avatar = styled.figure`
  display: inherit;
  align-items: inherit;

  img {
    width: 2.4vmax;
    height: auto;
    vertical-align: middle;
  }

  figcaption {
    opacity: 0.8;
    padding-left: 1.2vmax;
  }
`

export default () => (
  <Avatar>
    <img
      alt="❤️"
      src="data:image/jpeg;base64,"
    />

    <figcaption>
      by aisa<br />
      at <time>{randDate()}</time>
    </figcaption>
  </Avatar>
)

const randDate = (start = new Date(3333, 0, 1), end = new Date(6666, 0, 1)) =>
  parseInt(new Date(start.getTime() + Math.random() * (end.getTime() - start.getTime())).getTime() / 1000, 10)
